GameLevel::GameDifficultyEnum GameLevel::toGameDifficultyEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("VERY_EASY")) {
        return GameDifficultyEnum::VERY_EASY;
    }
    
    if (value == utility::conversions::to_string_t("EASY")) {
        return GameDifficultyEnum::EASY;
    }
    
    if (value == utility::conversions::to_string_t("MEDIUM")) {
        return GameDifficultyEnum::MEDIUM;
    }
    
    if (value == utility::conversions::to_string_t("HARD")) {
        return GameDifficultyEnum::HARD;
    }
    
    if (value == utility::conversions::to_string_t("VERY_HARD")) {
        return GameDifficultyEnum::VERY_HARD;
    }
    
    throw std::invalid_argument("Invalid value for conversion to GameDifficultyEnum");
}


const utility::string_t GameLevel::fromGameDifficultyEnum(const GameDifficultyEnum value) const
{
    switch(value)
    {
        
        case GameDifficultyEnum::VERY_EASY: return utility::conversions::to_string_t("VERY_EASY");
        
        case GameDifficultyEnum::EASY: return utility::conversions::to_string_t("EASY");
        
        case GameDifficultyEnum::MEDIUM: return utility::conversions::to_string_t("MEDIUM");
        
        case GameDifficultyEnum::HARD: return utility::conversions::to_string_t("HARD");
        
        case GameDifficultyEnum::VERY_HARD: return utility::conversions::to_string_t("VERY_HARD");
        
    }
}

